export default function GetTagFromJSON () {
const tagOfFilm = require('./my-app/tags.json');
const tags = [];
  for (i=0;i<tagOfFilm.arr[i]-1;i++) {
    let name=tagOfFilm.arr[i];
    function tagToObj (name){
       this.title=name;
    }
    tags.push(new tagToObj) 
  }
  return tags
}
